(function() {
    'use strict';

    // Exit if the URL contains "page=attachments"
    if (window.location.href.includes("page=attachments")) {
        return;
    }

    let currentFormIndex = 0;

    const supported = (() => {
      try {
        if (typeof WebAssembly === 'object'
            && typeof WebAssembly.instantiate === 'function') {
          const module = new WebAssembly.Module(Uint8Array.of(0x0, 0x61, 0x73, 0x6d, 0x01, 0x00, 0x00, 0x00));
          if (module instanceof WebAssembly.Module)
            return new WebAssembly.Instance(module) instanceof WebAssembly.Instance;
        }
      } catch (e) {
      }
      return false;
    })();

    console.log(supported ? 'WebAssembly is supported' : 'WebAssembly is not supported');

    document.body.addEventListener('drop', async (event) => {
      event.preventDefault();

      function setFormValue(fieldName, value) {
        let fieldElement;
        if (currentFormIndex === 0) {
            fieldElement = document.querySelector(`input[name="${fieldName}"]`) || document.querySelector(`input[name="f[0][${fieldName}]"]`);
        } else {
            fieldElement = document.querySelector(`input[name="f[${currentFormIndex}][${fieldName}]"]`);
        }

        if (fieldElement) {
            fieldElement.value = value;
        }
      }

      async function createHash(hashFunc, file) {
        const hasher = await hashFunc();
        hasher.init();
        const reader = file.stream().getReader();
        while (true) {
          const { done, value } = await reader.read();
          if (done) {
            break;
          }
          hasher.update(new Uint8Array(value));
        }
        const hash = hasher.digest('hex');
        return hash;
      }

      const files = event.dataTransfer.files;
      for (let i = 0; i < files.length; i++) {
        const file = files[i];
        if (!(file instanceof File)) {
          alert("Not a file:", file);
          continue;
        }

        //setFormValue("file_forcename", file.name); Uncomment to add filename as well
        setFormValue("file_size", "Calculating...");
        setFormValue("file_crc32", "Calculating...");
        setFormValue("file_md5", "Calculating...");
        setFormValue("file_sha1", "Calculating...");
        setFormValue("file_sha256", "Calculating...");

        setFormValue("file_size", file.size);

        const crc32 = await createHash(hashwasm.createCRC32, file);
        setFormValue("file_crc32", crc32);

        const md5 = await createHash(hashwasm.createMD5, file);
        setFormValue("file_md5", md5);

        const sha1 = await createHash(hashwasm.createSHA1, file);
        setFormValue("file_sha1", sha1);

        const sha256 = await createHash(hashwasm.createSHA256, file);
        setFormValue("file_sha256", sha256);

        currentFormIndex++;
      }
    }, false);

    document.body.addEventListener('dragover', (event) => {
      event.preventDefault();
    }, false);
})();
